// src/highlight/constants.ts
var ADDON_ID = "storybook/highlight";
var HIGHLIGHT = `${ADDON_ID}/add`;
var REMOVE_HIGHLIGHT = `${ADDON_ID}/remove`;
var RESET_HIGHLIGHT = `${ADDON_ID}/reset`;
var SCROLL_INTO_VIEW = `${ADDON_ID}/scroll-into-view`;
var MAX_Z_INDEX = 2147483647;
var MIN_TOUCH_AREA_SIZE = 28;

export {
  HIGHLIGHT,
  REMOVE_HIGHLIGHT,
  RESET_HIGHLIGHT,
  SCROLL_INTO_VIEW,
  MAX_Z_INDEX,
  MIN_TOUCH_AREA_SIZE
};
